import React from 'react'
import '../styles/navbar.css'
import image1 from './assets/images/bg-body-bottom.jpg'
function Navbar() {
    return (
        <section className="navbar">
            
            <div className="max-width">
                <div className="container">
                    <img src={image1} alt="" />
                </div>
            </div>
        </section>
    )
}

export default Navbar;
